"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Capsule, delayed release",
"     </b>",
"     (Prevacid 24HR Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     15 mg (14): $10.67",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Capsule, delayed release",
"     </b>",
"     (Prevacid Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     15 mg (30): $249.76",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     30 mg (100): $832.51",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Suspension",
"     </b>",
"     (First-Lansoprazole Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     3 mg/mL (150 mL): $62.20",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tablet, orally-disintegrating",
"     </b>",
"     (Prevacid SoluTab Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     15 mg (100): $832.51",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     30 mg (100): $832.51",
"    </p>",
"   </div>",
"   <div class=\"block mop drugH1Div\" id=\"F186728\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Patients with Zollinger-Ellison syndrome should be monitored for gastric acid output, which should be maintained at &le;10 mEq/hour during the last hour before the next lansoprazole dose; lab monitoring should include CBC, liver function, renal function, and serum gastrin levels",
"    </p>",
"   </div>",
